INSERT INTO `Data_Artikel` (`id_Artikel`, `Judul_Artikel`, `Deskripsi_Artikel`, `Tanggal_Artikel`, `Jalan_Artikel`, `id_Desa`, `id_Kecamatan`) VALUES
(25, 'Menikmati Keindahan Alam Desa Jalan Jawa', 'Desa Jalan Jawa menawarkan keindahan alam yang masih alami dan terjaga. Dikelilingi oleh pegunungan hijau dan sungai-sungai yang jernih, desa ini cocok untuk liburan yang tenang dan santai.', '2024-06-15', 'Jalan Jawa 2b No 23', 1, 1),
(26, 'Eksplorasi Alam Desa Jalan Jawa: Trekking dan Berenang', 'Nikmati pengalaman trekking yang menantang di hutan-hutan Desa Jalan Jawa, atau berenang di sungai-sungai yang segar dan alami. Petualangan alam yang tak terlupakan!', '2024-06-16', 'Jalan Jawa 2b No 23', 1, 1),
(27, 'Wisata Budaya di Desa Jalan Jawa', 'Selain keindahan alamnya, Desa Jalan Jawa juga kaya akan budaya dan tradisi. Kunjungi penduduk setempat, ikuti acara-acara tradisional, dan rasakan kehangatan keramahan mereka.', '2024-06-17', 'Jalan Jawa 2b No 23', 1, 1),
(28, 'Menyatu dengan Alam Desa Jalan Jawa', 'Berpeluk erat dengan alam Desa Jalan Jawa yang masih asli dan indah. Rasakan kedamaian dan ketenangan yang sulit ditemukan di tengah hiruk-pikuk perkotaan.', '2024-06-18', 'Jalan Jawa 2b No 23', 1, 1),
(29, 'Petualangan Seru di Desa Jalan Jawa', 'Desa Jalan Jawa menyajikan petualangan seru bagi para pengunjungnya. Mulai dari menelusuri hutan-hutan, bermain air di sungai, hingga mendaki puncak-puncak tertinggi.', '2024-06-19', 'Jalan Jawa 2b No 23', 1, 1),
(30, 'Keindahan Senja di Desa Jalan Jawa', 'Nikmati keindahan senja yang memukau di Desa Jalan Jawa. Dikelilingi oleh pegunungan dan hutan-hutan yang menyala dengan warna-warni matahari terbenam.', '2024-06-20', 'Jalan Jawa 2b No 23', 1, 1),
(31, 'Mencicipi Kuliner Khas Desa Jalan Jawa', 'Jelajahi beragam kuliner khas Desa Jalan Jawa yang lezat dan menggugah selera. Rasakan cita rasa autentik dari masakan tradisional yang disajikan dengan penuh kehangatan.', '2024-06-21', 'Jalan Jawa 2b No 23', 1, 1),
(32, 'Rekreasi Keluarga di Desa Jalan Jawa', 'Bawa keluarga Anda untuk berlibur di Desa Jalan Jawa. Nikmati momen berkualitas bersama di tengah alam yang hijau dan udara yang segar.', '2024-06-22', 'Jalan Jawa 2b No 23', 1, 1),
(33, 'Pengalaman Seru Camping di Desa Jalan Jawa', 'Jadikan liburan Anda lebih berkesan dengan camping di Desa Jalan Jawa. Dengarkan suara alam yang merdu dan nikmati malam yang tenang di bawah bintang-bintang.', '2024-06-23', 'Jalan Jawa 2b No 23', 1, 1),
(34, 'Menikmati Keindahan Alam Desa Jalan Jawa', 'Desa Jalan Jawa menawarkan keindahan alam yang masih alami dan terjaga. Dikelilingi oleh pegunungan hijau dan sungai-sungai yang jernih, desa ini cocok untuk liburan yang tenang dan santai.', '2024-06-15', 'Jalan Jawa 2b No 23', 1, 1),
(35, 'Alun-Alun', 'Alun alun Jember', '2024-06-14', 'Jalan PB. Sudirman', 136, 1);
